"""
iven a wordlist, we want to implement a spellchecker that converts a query word into a correct word.

For a given query word, the spell checker handles two categories of spelling mistakes

Capitalization If the query matches a word in the wordlist (case-insensitive), then the query word is returned with the same case as the case in the wordlist.
Example wordlist = [yellow], query = YellOw correct = yellow
Example wordlist = [Yellow], query = yellow correct = Yellow
Example wordlist = [yellow], query = yellow correct = yellow
Vowel Errors If after replacing the vowels ('a', 'e', 'i', 'o', 'u') of the query word with any vowel individually, it matches a word in the wordlist (case-insensitive), then the query word is returned with the same case as the match in the wordlist.
Example wordlist = [YellOw], query = yollow correct = YellOw
Example wordlist = [YellOw], query = yeellow correct =  (no match)
Example wordlist = [YellOw], query = yllw correct =  (no match)
In addition, the spell checker operates under the following precedence rules

When the query exactly matches a word in the wordlist (case-sensitive), you should return the same word back.
When the query matches a word up to capitlization, you should return the first such match in the wordlist.
When the query matches a word up to vowel errors, you should return the first such match in the wordlist.
If the query has no matches in the wordlist, you should return the empty string.
Given some queries, return a list of words answer, where answer[i] is the correct word for query = queries[i].

 

Example 1

Input wordlist = [KiTe,kite,hare,Hare], queries = [kite,Kite,KiTe,Hare,HARE,Hear,hear,keti,keet,keto]
Output [kite,KiTe,KiTe,Hare,hare,,,KiTe,,KiTe]
 

Note

1 = wordlist.length = 5000
1 = queries.length = 5000
1 = wordlist[i].length = 7
1 = queries[i].length = 7
All strings in wordlist and queries consist only of english letters.
"""
import re
class Solution_1:
    def spellchecker(self, wordlist, queries):
        """
        :type wordlist: List[str]
        :type queries: List[str]
        :rtype: List[str]
        """
        """
        Too Slow
        """



        res = ["" for i in range(len(queries))]
        wordlist_lower_dict = dict()
        nonvowel_dict = dict()
        for index,word in enumerate(wordlist):
            word = word.lower()
            if word not in wordlist_lower_dict:
                wordlist_lower_dict[word] = index
            # nonvowel_word = ''.join(re.split('a|e|i|o|u', word))
            nonvowel_word = '@'.join(re.split('[aeiou]', word))
            if nonvowel_word not in nonvowel_dict:
                nonvowel_dict[nonvowel_word] = index
        

        for index, query in enumerate(queries):
            if query in wordlist:
                res[index] = query
            else:
                query = query.lower()
                if query in wordlist_lower_dict:
                    res[index] = wordlist[wordlist_lower_dict[query]]
                else:
                    query = '@'.join(re.split('[aeiou]', query))
                    if query in nonvowel_dict:
                        res[index] = wordlist[nonvowel_dict[query]]
        return res

class Solution:
    def spellchecker(self, wordlist, queries):
        """
        :type wordlist: List[str]
        :type queries: List[str]
        :rtype: List[str]
        """
        """
        Change list to dict to make it faster
        """
        res = ["" for i in range(len(queries))]
        wordlist_lower_dict = dict()
        nonvowel_dict = dict()
        word_dict = dict()
        for index,word in enumerate(wordlist):
            word_dict[word] = index
            word = word.lower()
            if word not in wordlist_lower_dict:
                wordlist_lower_dict[word] = index
            # nonvowel_word = ''.join(re.split('a|e|i|o|u', word))
            nonvowel_word = '@'.join(re.split('[aeiou]', word))
            if nonvowel_word not in nonvowel_dict:
                nonvowel_dict[nonvowel_word] = index
        # print(nonvowel_dict)
        

        for index, query in enumerate(queries):
            if query in word_dict:
                res[index] = wordlist[word_dict[query]]
            else:
                query = query.lower()
                if query in wordlist_lower_dict:
                    res[index] = wordlist[wordlist_lower_dict[query]]
                else:
                    query = '@'.join(re.split('[aeiou]', query))
                    if query in nonvowel_dict:
                        res[index] = wordlist[nonvowel_dict[query]]
        return res

